public class Solution {
    public String removeDuplicateLetters(String s) {
        if (s == null || s.length() <= 1) return s;

        int[] count = new int[26]; // count the number of each char in string s
        for (char c : s.toCharArray()) {
            count[c - 'a']++;
        }

        Stack<Character> stack = new Stack<>();
        boolean[] visited = new boolean[26]; // mark whether a char has been added to result or not

        for (int i = 0; i < s.length(); i++) {
            char cur = s.charAt(i);
            count[cur - 'a']--;

            /*
             * If current char is smaller than top element, and it's unvisited, then pop all elements that are larger than current char from stack until we find an unvisited one.
             */
            while (!stack.isEmpty() &&!visited[stack.peek() - 'a'] && stack.peek() > cur) {
                if (count[stack.peek() - 'a'] == 0) break;
                stack.pop();
            }

            if (!visited[cur - 'a']) {
                stack.push(cur);
                visited[cur - 'a'] = true;
            }
        }

        StringBuilder sb = new StringBuilder();
        while (!stack.isEmpty()) {
            sb.append(stack.pop());
        }

        return sb.reverse().toString();
    }
}
